import styled from 'styled-components';


export const NavigationBar = styled.nav`
  font-family: 'Lato', sans-serif;
  display: flex;
  justify-content: flex-end;
  width: 100%;
  height: 20%;

    .home {
      position: absolute;
      font-size: 2em;
      color: white;
      width: 207px; 
      height: 25px; 
      left: 11%;  
      z-index: 200;   
    }

    .uList {
      display: flex;
      align-items: center;
      justify-content: flex-end;
      height: 15%;
      width: 50%;
      padding-right: 128px;
    
        li {
          position: absolute;
                    
          font-size: 15px;
          list-style: none;
          color: white;
          padding: 23.5px;
        }

        

        img {
          width: 24px;
          height: 26px;
          padding-left: 47px;
        }
  }

  
  }
  
`;
